import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="app">
      <div className="landing-page">
        <header className="app-header">
          <p className="header1">I'm Cathleen. I'm a designer - developer.</p>
          <p className="header1">I create radically different digital experiences to empower others and enable ideas.</p>
        </header>
      </div>
    </div>
  );
}

export default App;
